import logo from './logo.svg';
import './App.css';

//компонента App
function App() {
	return (
		<div>
		<div><Header /></div>
		<div className="App">
			<ul>
				<li>qwe</li>
				<li>asd</li>
				<li>asd</li>
			</ul>

		</div>
		</div>
	);
}

function Header() {
	return (
		<div className="App">
			<ul>
				<li>qwe</li>
				<li>asd</li>
				<li>asd</li>
			</ul>

		</div>
	);
}

export default App;
